          </div>
          <div 
            className={`model-button ${buttonStates.gta5artworkdiffusion ? 'button-on' : 'button-off'}`}
            onClick={() => handleButtonToggle('gta5artworkdiffusion', 'style')}
            >
            <div className="button-image">
              <img src="gta5artworkdiffusion.jpg" alt="GTA5 Artwork Diffusion" />
            </div>
            <h3>GTA5 Artwork Diffusion</h3>
            <p>Blend the worlds of GTA5 and artwork with the Artwork Diffusion model.</p>
          </div>
        </div>
      </div>

      <div className="tab-content" id="parametresTab" style={{ display: activeTab === 'Paramètres' ? 'block' : 'none' }}>
        <div className="parametre">
          <label htmlFor="imageWidth">Image Width:</label>
          <input
            type="range"
            id="imageWidth"
            min="100"
            max="1000"
            step="10"
            value={imageWidth}
            onChange={handleImageWidthChange}
          />
          <input
            type="text"
            value={imageWidth}
            onChange={handleImageWidthChange}
          />
        </div>
        <div className="parametre">
          <label htmlFor="imageHeight">Image Height:</label>
          <input
            type="range"
            id="imageHeight"
            min="100"
            max="1000"
            step="10"
            value={imageHeight}
            onChange={handleImageHeightChange}
          />
          <input
            type="text"
            value={imageHeight}
            onChange={handleImageHeightChange}
          />
        </div>
        <div className="parametre">
          <label htmlFor="seed">Seed:</label>
          <input
            type="text"
            id="seed"
            value={seed}
            onChange={handleSeedChange}
          />
        </div>
        <div className="parametre">
          <label htmlFor="generationSteps">Generation Steps:</label>
          <input
            type="range"
            id="generationSteps"
            min="1"
            max="50"
            step="1"
            value={generationSteps}
            onChange={handleGenerationStepsChange}
          />
          <input
            type="number"
            value={generationSteps}
            onChange={handleGenerationStepsChange}
          />
        </div>
        <div className="parametre">
          <label htmlFor="guidanceScale">Guidance Scale:</label>
          <input
            type="range"
            id="guidanceScale"
            min="0"
            max="10"
            step="0.5"
            value={guidanceScale}
            onChange={handleGuidanceScaleChange}
          />
          <input
            type="number"
            step="0.5"
            value={guidanceScale}
            onChange={handleGuidanceScaleChange}
          />
        </div>
      </div>
      <div className="header">Gallery</div>
      <div className="gallery">
        {images.map((image) => (
          <img
            key={image._id}
            src={image.imageUrl}
            alt={image.prompt}
            className={selectedPhoto === image._id ? 'selected' : ''}
            onClick={() => handlePhotoClick(image._id)}
          />
        ))}
      </div>
      {selectedPhoto && (
        <div className="selected-photo">
          <img src={selectedPhoto.imageUrl} alt="Selected Image" className="selected-image" />
          <div className="caption">{selectedPhoto.prompt}</div>
        </div>
      )}
    </div>
  );
};

export default HomePage;
